import Shell from "./Shell";
import TextField from "@mui/material/TextField";
import store from "../../store";
import { getState } from "redux";

function Policies() {
  return (
    <Shell
      heading="Policies"
      index={4}
      content={store.getState().policies.map((policy) => (
        <p>{policy.policy}</p>
      ))}
    />
  );
}

export default Policies;
